INSERT INTO `content` VALUES (1,'<div class=\"itemFullText\">\n	  	\n<p><img style=\"margin: 0px 25px 15px 0px; float: left;\" src=\"http://www.fimek.edu.rs/images/studije/informatika.jpg\" alt=\"Informatika\" title=\"Informatika\" class=\"img-border2\">Studijski program <strong>Informatika</strong> koncipiran je u skladu sa Zakonom o visokom obrazovanju i Bolonjskom deklaracijom.</p>\n<p>Studijski program <strong>Informatika</strong> namenjen je onima koji Å¾ele da se steknu savremena i kvalitetna znanja iz oblasti raÄunarskih nauka i informacionih tehnologija.</p>\n<p>Razvijeni svet je u poslednjih deset godina preÅ¡ao u informaciono druÅ¡tvo, podstaknut naglim i snaÅ¾nim razvojem raÄunarske nauke i tehnologije koja je postala nezamenljiv deo intenzivnog razvoja svakog druÅ¡tva. Danas u Srbiji ima oko 12000 IT struÄnjaka koji su zaposleni u oko 1500 preduzeÄ‡a, i to ne samo u IT kompanijama veÄ‡ i u bankarskom sektoru, telekomunikacijama, medijima, Å¡kolama, univerzitetima itd. MeÄ‘utim, danas u Srbiji nisu zadovoljene godiÅ¡nje potrebe za struÄnjacima iz oblasti IT sektora, tako da najveÄ‡i problem predstavlja pronalaÅ¾enje visoko struÄnih kadrova. Stoga, cilj studijskog programa Informatika jeste da obezbedi sticanje nauÄnih i struÄnih znanja i veÅ¡tina koje su u skladu sa najviÅ¡im evropskim akademskim standardima, kao i sa zahtevima trÅ¾iÅ¡ta rada. Tokom studija iz studentima se pruÅ¾aju savremena znanja i veÅ¡tine iz projektovanja, razvoja i primene savremenih softverskih sistema. Poseban naglasak je stavljen na usvajanje sveobuhvatnih znanja iz projektovanja fiziÄke arhitekture, sistemske programske podrÅ¡ke, meÄ‘uraÄunarskih komunikacija i arhitektura i algoritama, a zatim i na osposoblÑ˜avanje studenata za projektovanje i razvoj namenskih raÄunarskih struktura i razvoj platformi i sistema za rad u realnom vremenu.</p>\n<p>Tokom studija organizovana je struÄna praksa kao deo nastavnog procesa, kako bi se kod studenata razvile veÅ¡tine koje zahteva savremeno trÅ¾iÅ¡te rada, a u cilju sveobuhvatne pripreme studenata za uspeÅ¡no zaposlenje i razvoj karijere.</p>\n<p>Nakon zavrÅ¡etka studijskog programa Informatika studenti su kompetentni i druÅ¡tveno odgovorni struÄnjaci, svestrano osposobljeni za rad u privredi, bankarskom sektoru, telekomunikacijama, medijima, kao i za uspeÅ¡no izvoÄ‘enje nastave iz raÄunarstva i informatike kako u osnovnim tako i u srednjim Å¡kolama. VaÅ¾no je istaÄ‡i da zanimanja iz oblasti informacionih tehnologija predstavljaju najtraÅ¾enija i najplaÄ‡enija zanimanja danaÅ¡njice, tako Ä‡e po zavrÅ¡etku studija, studentima biti na raspolaganju moguÄ‡nost zaposlenja na poslovima kao Å¡to su web developer, softwere developer, programer, web administrator, sistem administrator, analitiÄar informacionih sistema itd. TakoÄ‘e, na Forbsovom spisku 20 najbogatijih ljudi Äak Äetvoro su iz oblasti informacionih tehnologija. Stoga je ovaj studijski program interesantan za sve one koji Å¾ele uspeÅ¡no zaposlenje.</p>\n<p>Nastava je interaktivna i ostvaruje se u malim grupama i kroz mentorski rad. Kroz interaktivnu nastavu naglasak se stavlja na isticanje individualnog, kreativnog razvoja studenata, timski rad, sticanje praktiÄnih znanja i koriÅ¡Ä‡enje savremene tehnologije, kao i na uspostavljanje neposrednog odnosa izmeÄ‘u studenata i profesora. Kvalitetu nastavnog procesa doprinose i gostovanja struÄnjaka iz privrede.</p>\n<p>Studijski program Informatika traje Äetiri godine i njegovim zavrÅ¡etkom studenti stiÄu 240 ESPB bodova i zvanje <strong>DIPLOMIRANI INFORMATIÄŒAR</strong>. Po zavrÅ¡etku osnovnih akademskih studija student moÅ¾e nastaviti master studije u trajanju od jedne godine.</p>\n<h5 class=\"de-typo\">Nastavni plan studijskog programa</h5>\n<p class=\"de-typo\">Informatika - Osnovne akademske studije</p>\n<div class=\"table-responsive\">\n<table class=\"table table-striped table-hover table-bordered\" style=\"width: 100%;\" summary=\"Plain Rows style\" border=\"0\">\n<thead>\n<t